import React from 'react'

function Signup() {
    const box={
        width:'70%',
        height:'80vh',
        backgroundColor:'white',
        boxShadow:'0px 5px 15px black',
        position:'absolute',
        top:'100px',
        marginRight:'15%',
        marginLeft:'15%', 
    }
    const text={
        margin:'20px',
    }
    return (
        <>
        <div style={box}>
            <h1 style={text}>Create User</h1>
            </div>
        </>
    )
}

export default Signup
